[[File:Bird nest (Wyson, 2016-2019) detail.png|left|200px]]
The discontinued '''bird nest''' from [[Wyson]] was an old variant of the [[Bird nest (Wyson)|Wyson seed nest]] obtainable before the release of the [[Farming Guild]]. After this update, the existing nests were discontinued, and newly obtained nests would instead be the current variant. All nests previously obtained would remain in banks and inventories, and the new nests obtained would provide [[snape grass seed|snape grass]], [[dragonfruit tree seed|dragonfruit]], [[celastrus seed|celastrus]], and [[redwood tree seed]]s. This change was made to prevent players from obtaining large quantities of the new seeds immediately upon release of the content.

Like the current version of bird nests, they were obtained from [[Wyson]] in exchange for [[mole claw]]s and [[mole skin]]s.

